// SPDX-License-Identifier: MIT
pragma solidity >=0.4.21;
pragma experimental ABIEncoderV2;
import './Operations.sol';

contract CompanyContract is Operations{

    struct companyStruct {
      string companyname;
      string companyID;
      string email;
      string phone;
      string Haddress;
      string areaCode;
    }

    mapping (address => string) public companyIdMap;
    mapping (string => companyStruct) public companyDetailsMap;

    uint Companycount;

    constructor() public {
        Companycount=0;
    }

    function registerCompany(address _cmpaddr, string memory name, string memory email, string memory phone,
                                            string memory Haddress, string memory area_code ) public 
    {
        Companycount++;
        //Convert int to string 
        string memory H="B";
        string memory companyID=concatenate(H,IntToString(Companycount));

        companyIdMap[_cmpaddr]=companyID;
        companyDetailsMap[companyID]=companyStruct(name,companyID,email,phone,Haddress,area_code);
    }

    function getUserID(address _usraddr) public view returns (string memory _companyID) {
        return companyIdMap[_usraddr];
    }

    function getUser(string memory companyID) public view returns (companyStruct memory _companyStruct) {
        return companyDetailsMap[companyID];
    }

}
